  width: 100%;
  min-height: 100vh;
  background: url("/images/bgdekstop.jpg") no-repeat center;
  background-size: cover;
  align-items: center;
  justify-content: center;
`;

const Hero = () => {
  return (
    <Wrapper>
      {/* <Typing>
        <div>
          There will be a 1000ms delay here,
          <Typing.Delay ms={1000} />
          then this will be typed.
        </div>
      </Typing> */}
    </Wrapper>
  );
};

export default Hero;
